function w2_cmd = FMtow2(L, Thrust_const, Twist_const, Thrust, TQ_roll_X, TQ_pit_Y, TQ_yaw_Z)
%#codegen

    % simplify the variable names
    b = Thrust_const;
    k = Twist_const;

    % construct the co-efficient matrix:
    %  F_and_M = C * w^2
    %
    C = [     b,    b,    b,    b;
              0,    b*L,  0,   -b*L;
             -b*L,  0,    b*L,  0;
             -k,    k,   -k,    k; ];

    % used Symbolic toolbox to compute inv(C)
    C_inv = [
             1/(4*b),          0, -1/(2*L*b), -1/(4*k);
             1/(4*b),  1/(2*L*b),          0,  1/(4*k);
             1/(4*b),          0,  1/(2*L*b), -1/(4*k);
             1/(4*b), -1/(2*L*b),          0,  1/(4*k);
            ];
    % solve for the w^2 vec
    F_and_M_col = [Thrust, TQ_roll_X, TQ_pit_Y, TQ_yaw_Z].' ;
    w2_cmd      = C_inv * F_and_M_col; 
    % check that ALL w^2 >=0
    tf_col      = (w2_cmd >= 0);
%     if( ~all(tf_col) )
%         w2_cmd = lsqnonneg(C, F_and_M_col);
%     end
%     
%     tf_again_col = (w2_cmd >= 0);
%     assert(all(tf_again_col), 'ERROR: ohh dear some w2 are NEGATIVE !')

%     for kk=1:4
%       fprintf('\n ... [%.16f]', w2_cmd(kk) );
%     end
%     fprintf('\n -----------------------------------------------');
    assert(all(tf_col), 'ERROR: ohh dear some w2 are NEGATIVE !')

% 
%      if( ~all(tf_col) )
%        fprintf('\n ..... WHAT HAPPENED !');
%      end
%     assert(all(tf_col), 'ERROR: ohh dear some w2 are NEGATIVE !')
   %assert(false, 'ERROR: some w2 are NEGATIVE !')
end

function [Tbz_col, Mbz_col, wM_col] = w2toFM(L, Thrust_const, Twist_const, w2_col)
%#codegen

    % simplify the variable names
    b = Thrust_const;
    k = Twist_const;

    % construct the co-efficient matrix:
    %  F_and_M = C * w^2

%     C = [     b,    b,    b,    b;
%               0,    b*L,  0,   -b*L;
%              -b*L,  0,    b*L,  0;
%              -k,    k,   -k,    k; ];

    Tbz_col = [ b; b; b; b ]  .*  w2_col;     
    Mbz_col = [-k; k;-k; k ]  .*  w2_col;          
    wM_col  = [ 1;-1; 1;-1 ]  .*  sqrt(w2_col); 
end
